import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import Svg, { Circle } from 'react-native-svg';
import { SvgXml } from 'react-native-svg';

//https://blog.logrocket.com/how-to-use-svgs-react-native-tutorial-with-examples/
export default function App() {
  const xml = `
  <svg width="347" height="155" viewBox="0 0 347 155" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
  <rect width="347" height="155" rx="34" fill="url(#pattern0)"/>
  <defs>
  <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
  <use xlink:href="#image0_9_213" transform="matrix(0.000718144 0 0 0.00160772 -0.00341929 0)"/>
  </pattern>
  <image id="image0_9_213" width="1402" height="622" xlink:href="data:image/png;base64,"/>
  </defs>
  </svg>
  
`;
  return (
    <View style={styles.container}>
      <Svg height="50%" width="50%" viewBox="0 0 100 100" >
        <Circle cx="50" cy="50" r="50" stroke="purple" strokeWidth=".5" fill="violet" />
        <Text style={{
          textAlign:'center',
          position:'relative',
          top:160,
          fontSize:25
        }}>Hola</Text>
      </Svg>
      <SvgXml xml={xml} width="100%" height="50%" />

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
  },
});
